import { Col, Breadcrumb, Form, FormControl, Button } from "react-bootstrap";

const FoldersHeaderBar = () => {
  return (
    <React.Fragment>
      <Col>
        <div className="folders-navigation">
          <Breadcrumb>
            <Breadcrumb.Item active href="#">
              Strona główna
            </Breadcrumb.Item>
          </Breadcrumb>
        </div>
      </Col>
      <Col>
        <div className="search-bar">
          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="primary">Search</Button>
          </Form>
        </div>
      </Col>
    </React.Fragment>
  );
};

export default FoldersHeaderBar;
